import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Body-navbar.css';
import {
  BrowserRouter as Router,
   Link,Route,Switch,NavLink
} from "react-router-dom";
import Home from '../Out/Home/Home';
// import Contact from '../Out/Contact/Contact';
import Search from '../Out/Search/Search';
import Shirt from '../Out/Shirt/Shirt';
import Shirt_len from '../Out/Shirt/Shirt_len/Shirt_len';
import Shirt_thun from '../Out/Shirt/Shirt_thun/Shirt_thun';
import Shirt_khoac from '../Out/Shirt/Shirt_khoac/Shirt_khoac';
import Trousers from '../Out/Trousers/Trousers';
import Trouser_sooc from '../Out/Trousers/Trouser-sooc/Trouser-sooc';
import Trouser_jean from '../Out/Trousers/Trouser-jean/Trouser-jean';
import Trouser_baggy from '../Out/Trousers/Trouser-baggy/Trouser-baggy';
// import Shirt_somi from '../Out/Shirt/Shirt_somi/Shirt_somi';
import Shirt_somi from '../Out/Shirt/Shirt_somi/Shirt_somi';
import Products from '../Out/Products/Products';
// import Routershirt from '../Out/Shirt/Router';
import Contact from '../Out/Contact/Contact';
import Login from '../Login';
import Cart from '../Out/Cart/Cart';
import axios from "axios"
class Bodynavbar extends Component {
  constructor (props) {
    super(props)
    this.state = {
      order:[],
      name:'',
      dem:[]
    }
 }
 componentDidMount() {
  axios.get('/order')
  .then(res=>{
    console.log(res.data);
    this.setState({
      order:res.data
  });
  })
  // axios.get('/test')
  // .then(res=>{
  //   console.log(res.data);
  //   this.setState({
  //     name:res.data
  // });
  // })
}
  render(){
    console.log(this.state.order)
  return (
    <Router>
      <div class="navbar1">
        <NavLink to="/"><i class="fas fa-home"></i></NavLink>
        <div class="subnav">
          <button class="subnavbtn"><NavLink to="/shirt">Áo</NavLink> </button>
          <div class=" subnav-content ">
            <div className="row" >
              <a className="col-6">
                <div className="abc1"><b>Áo</b></div>
                <Link to="/shirt_len"><div className="abcd">Áo len</div></Link>
                <Link to="/shirt_somi"><div className="abcd">Áo sơ mi</div></Link>
                <Link to="/shirt_thun"><div className="abcd">Áo thun</div></Link>
                <Link to="/shirt_khoac"><div className="abcd">Áo khoác</div></Link>
              </a>
              <a className="col-6">
                <img className="img1"  src="http://localhost:4000/anh/menu-ao-92w"></img>
              </a>
            </div>
          </div>
        </div>
        <div class="subna">

        </div>
      </div>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/login1" component={Login}/>
        <Route path="/search" component={Search}/>
        <Route path="/search?" component={Search}/>
        <Route path="/contact" exact component={Contact} />
        <Route path="/cart" exact render={props => <Cart {...props} data={this.state.order}  />}/>
        <Route path="/shirt" exact component={Shirt} />
         <Route path="/shirt_len" exact component={Shirt_len} />
         <Route path="/shirt_thun" exact component={Shirt_thun} />
         <Route path="/shirt_khoac" exact component={Shirt_khoac} />
         <Route path="/trouser" exact component={Trousers} />
         <Route path="/trouser_sooc" exact component={Trouser_sooc} />
         <Route path="/trouser_jean" exact component={Trouser_jean} />
         <Route path="/trouser_baggy" exact component={Trouser_baggy} />
         <Route path="/shirt_somi" exact component={Shirt_somi} />
        <Route path="/shirt/aaa"  component={Products} />
        <Route path="/:name"  component={Products} />
      </Switch>

    </Router>
  );
}}

export default Bodynavbar;
